    const ima = props.ima;
    const label = props.label;
    return(
        <div class="container-fluid">
            <img style={{width: "100px"}} src={ima} alt="Logo" />
            <input style={{margin: "50px"}} type="checkbox"></input>
            <h3 className="d-inline">{label}</h3>
        </div>

        );
    
  }
  export default imagg;
